class App extends React.Component {
  constructor(){
    super()
    console.log('App.js in Constructor')
    this.state = {
      drones: [],
    }
  }

  componentDidMount(){
    //function from react library
    console.log('App.js in ComponentDidMount')

    let URL = "http://localhost:3001/dragons"
    fetch(URL)
    .then(res => res.json())
    .then(dragons => {
      this.setState({
        dragons,

      })
    })

  }


  render(){
  return (
    <div className="App">
     <h1>Welcome to My App!</h1>
     <MyInfo />
     <MyForm />
    </div>
    ) 
  }
}

export default App;
